import React from "react";
import { TailSpin } from "react-loader-spinner";
import styled from "styled-components";

const SpinnerBox = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
`;

export default function LoadingSpinner() {


  return (
    <SpinnerBox>
      <TailSpin
        height="80"
        width="80"
        color="#dbdde9"
        ariaLabel="tail-spin-loading"
        radius="1"
        visible={true}
      />
    </SpinnerBox>
  );
}
